import React from 'react';
import OutputStyle from '../../Css/Components/HomeComponent/Output.module.css';


const Output = (props) => {
	return (
		<div>
			<div></div>
			<p className={`${OutputStyle.OutputValue}`}>{props.value}</p>
			
		</div>
	);

}

export default Output;
